import React from 'react';

class LoadPosts extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            data: this.props.content
        }
    }

    render() {


       this.state.data.map((val) => {
           return (
                <div>
                    <h1>{val.id}</h1>
                    <h1>{val.name}</h1>
                    <h1>{val.post}</h1>

                </div>
           )

       })

    }

}

export default LoadPosts;
